import react, { useState } from 'react'
import BtnGoogleGithub from './BtnGoogleGithub'

export default function SignIn() {
	const [form, setForm] = useState({
		email: '',
		senha: '',
	})

	const getValueInput = (e) => {
		if ((e.value.length === 1) || (e.value !== '' && e.value !== ' ')) {
			console.log(form)
			setForm({...form, [e.name]: e.value})
		}
	}
  return (
	<div className='signIn_signUp'>
		<h1>Sign-in</h1>

		<div className='form'>
			<div className='ctr-inputs'>
				<div className='ctr-input'>
					<input type='text' id='e-mail' name='email' value={form.email} onChange={(e) => {getValueInput(e.target)}}/>
					<label htmlFor='e-mail'>Digite seu E-mail:</label>
				</div>

				<div className='ctr-input' >
					<input type='password' id='senha' name='senha' value={form.senha} onChange={(e) => {getValueInput(e.target)}}/>
					<label htmlFor='senha'>Digite sua senha:</label>
				</div>
			</div>

			<button onClick={() => {alert('opa')}} className='btn-send'>Entrar</button>

			<BtnGoogleGithub/>
		</div>

	</div>
  )
}
